data.value:
  var tooltips = document.getElementsByName("tooltip");
  var n = tooltips.length;
  for (var i = 0; i < n; ++i) {
    var e = tooltips[i];
    var el = e.querySelector("[name='tooltip-element']");
    var tt = e.querySelector("[name='tooltip-tooltip']");
    el.onmousemove = function() {
      tt.setAttribute("visibility", "visible");
    }
    el.onmouseout = function(evt) {
      tt.setAttribute("visibility", "hidden");
    }
  }
};
